import React, { useState } from "react";
import { TFilter, TFilterConfig } from "../types";

type FiltersProps = {
  filterConfig: TFilterConfig;
  setFilterConfig: () => void;
};

export default function Filters({
  filterConfig,
  setFilterConfig,
}: FiltersProps) {
  // Update filter functions
  const handleCompleted = (value) => {
    return value.toString();
  };
  const handleNotCompleted = (value) => {
    return value.toString();
  };

  return (
    <div>
      <h1>Filters</h1>
      <div>
        <h2>Completed</h2>
        <label>
          <input
            type="checkbox"
            onChange={(event) => handleCompleted(event?.target)}
          />
          <span>Completed</span>
        </label>
        <label>
          <input
            type="checkbox"
            onChange={(event) => handleNotCompleted(event?.target)}
          />
          <span>Not Completed</span>
        </label>
      </div>
    </div>
  );
}
